import { client, ADD_ORDER } from "./actionTypes";

export const addToName = dispatch => (nameClient) => {
  dispatch({
    type: client,
    payload: nameClient
  })
}
export const addToOrder = dispatch => (product) => {
  dispatch({
    type: ADD_ORDER,
    product,
  })
}
